import React, { Component } from "react";

class FeelingProud extends Component {
  render() {
    const theme = this.props.theme;
    return (
      <div>
        <h1>Feeling Proud</h1>
        <img
          src="photo.jpg" // Replace with the actual path to your image
          alt="Feeling Proud"
          style={{ width: "300px", height: "200px" }} // You can adjust the width and height as needed
        />
      </div>
    );
  }
}

export default FeelingProud;
